import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  template: `
    <app-header></app-header>

    <router-outlet></router-outlet>

    <app-footer></app-footer> 
    <p id="divFooter" >ciao</p>
  `,
  styles: [`
  /* UTILITIES */
 
#divFooter {
    clear: both;
    position: relative;
    height: 200px;
    margin-top: -200px;
  }
  `,]
})
export class AppComponent {
  title = 'frontend';
}
